import { useState } from "react";
import style from "./FoodCell.module.css";

const FoodCell = (props) => {
  const food = props.food;

  const [dropActive,setDropActive] = useState(false)

  const drop = (<div className={style["drop"]}><div className={style["drop__content"]}>eqweq</div></div>)

  return (
    <div className={`${style["img-wrapper"]} ${dropActive && style["activated"]}`}>
      {drop}
      <span onClick={()=> {setDropActive((prevState) => !prevState)}}>
      <img src={food.img} alt={food.name}></img>
      <div className={style["name"]}>{food.name}</div>
      </span>
    </div>
  );
};

export default FoodCell;
